import React from 'react';
import { Modal, Button } from 'react-bootstrap';

const TermsModal = ({ show, handleClose }) => {
  return (
    <Modal show={show} onHide={handleClose}>
      <Modal.Header closeButton>
        <Modal.Title>Terms of Service</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <h5>Terms of Service for Your Project</h5>
        <p>
          Here you can add your terms of service content.
          For example, this could include rules, guidelines, and disclaimers about your project.
        </p>
        <p>
          You can add as much content as needed here. Make sure to include any important legal or user
          guidelines that users need to accept.
        </p>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={handleClose}>
          Close
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default TermsModal;
